package com.worldventures.dreamtrips.social.ui.bucketlist.presenter;import com.worldventures.dreamtrips.modules.common.model.User;import icepick.State;public class ForeignBucketTabPresenter extends BucketTabsPresenter {   @State User user;   public ForeignBucketTabPresenter(User user) {      this.user = user;   }   @Override   public void takeView(View view) {      bucketInteractor.bucketListActionPipe().clearReplays();      super.takeView(view);   }   @Override   protected User getUser() {      return user;   }}